const noticeScale = {
    1: 'mauvais',
    2: 'médiocre',
    3: 'bon',
    4: 'très bon',
    5: 'excellent'
}

function Notice({ noticeNumber }) {

    const range = [1, 2, 3, 4, 5]

    return (
        <div onClick={() => alert(`Ce produit a reçu une note de ${noticeScale[noticeNumber]} par nos clients`)}> 
            {range.map((notice) =>
                <span key={notice.toString()}>{notice}</span>
            )} 
        </div>
    )
}

export default Notice
